import React from 'react'
import { Route} from 'react-router-dom';

/**
* @author
* @function PrivateRoute
**/

const PrivateRoute = (props) => {
  return(
    <Route path={props.path}
    component = {props.component}
    exact = {props.exact}
    />
   );
 }

export default PrivateRoute;
